INSERT INTO `t_code_templates` VALUES (7, 'Entity', 'package ${package}.${moduleName}.entity;\n\nimport com.baomidou.mybatisplus.annotations.TableId;\nimport com.baomidou.mybatisplus.annotations.TableName;\nimport com.baomidou.mybatisplus.annotations.TableField;\nimport com.baomidou.mybatisplus.enums.IdType;\nimport com.baomidou.mybatisplus.activerecord.Model;\n\n#if(${hasBigDecimal})\nimport java.math.BigDecimal;\n#end\nimport java.io.Serializable;\nimport java.util.Date;\n\n/**\n * ${comments}\n *\n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\n@TableName(\"${tableName}\")\npublic class ${className}Entity extends Model<${className}Entity>  {\n     private static final long serialVersionUID = 1L;\n\n#foreach ($column in $columns)\n	/**\n	 * $column.comments\n	 */\n	#if($column.columnName == $pk.columnName)\n@TableId(value=\"${column.columnName}\", type= IdType.AUTO)\n	#else\n@TableField(\"${column.columnName}\")\n	#end\nprivate $column.attrType $column.attrname;\n#end\n\n#foreach ($column in $columns)\n	public void set${column.attrName}($column.attrType $column.attrname) {\n		this.$column.attrname = $column.attrname;\n	}\n\n	public $column.attrType get${column.attrName}() {\n		return $column.attrname;\n	}\n#end\n\n     @Override\n     protected Serializable pkVal() {\n              return this.id;\n     }\n\n     @Override\n     public String toString() {\n      return \"${tableName}{\" +\n	 #foreach($column in $columns)\n		#if($!{velocityCount}==1)\n \"${column.attrname}=\" + ${column.attrname} +\n		#else\n\", ${column.attrname}=\" + ${column.attrname} +\n	    #end\n	 #end\n     \"}\";\n     }\n}\n', 'Entity.java', 'entity', 10, 'java', '2018-06-04 15:04:16', '2018-06-04 15:18:44', NULL, 'generator生成模板', '0');
INSERT INTO `t_code_templates` VALUES (8, 'Dao', 'package ${package}.${moduleName}.dao;\n\nimport ${package}.${moduleName}.entity.${className}Entity;\nimport com.baomidou.mybatisplus.mapper.BaseMapper;\nimport org.apache.ibatis.annotations.Mapper;\nimport  ${package}.${moduleName}.entity.${className}Entity;\nimport java.util.List;\nimport java.util.Map;\n/**\n * ${comments}\n * \n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\npublic interface ${className}Dao extends BaseMapper<${className}Entity> {\n\n   List<Map<String, Object>> queryList(Map<String, Object> map);\n\n   ${className}Entity getInfo(Integer id);\n\n   List<${className}Entity> getDbInfo();\n	\n}\n', 'Dao.java', 'dao', 10, 'java', '2018-06-04 15:06:03', '2018-06-04 16:23:43', NULL, 'generator dao模板', '0');
INSERT INTO `t_code_templates` VALUES (9, 'Service', 'package ${package}.${moduleName}.service;\n\nimport com.baomidou.mybatisplus.service.IService;\nimport ${package}.${moduleName}.entity.${className}Entity;\n\nimport java.util.List;\nimport java.util.Map;\n\n/**\n * ${comments}\n *\n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\npublic interface ${className}Service extends IService<${className}Entity> {\n\n\n  /**\n      * 查询列表\n      *\n      * @param map\n      * @return\n      */\n     public List<Map<String, Object>> queryList(Map<String, Object> map);\n\n\n     /**\n      * 获取详情\n      * @return\n      */\n     public List<${className}Entity> getDbInfo() ;\n\n     /**\n      * 根据ID获取详情\n      *\n      * @param id\n      * @return\n      */\n     public ${className}Entity getInfo(Integer id);\n\n\n}\n\n', 'Service.java', 'service', 10, 'java', '2018-06-04 15:07:13', '2018-06-04 15:32:46', NULL, 'gen service生成模板', '0');
INSERT INTO `t_code_templates` VALUES (10, 'ServiceImpl', 'package ${package}.${moduleName}.service.impl;\n\nimport ${package}.${moduleName}.dao.${className}Dao;\nimport ${package}.${moduleName}.entity.${className}Entity;\nimport ${package}.${moduleName}.service.${className}Service;\nimport com.baomidou.mybatisplus.service.impl.ServiceImpl;\nimport org.springframework.stereotype.Service;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport java.util.List;\nimport java.util.Map;\n\n\n\n@Service(\"${classname}Service\" )\npublic class ${className}ServiceImpl extends ServiceImpl<${className}Dao, ${className}Entity> implements ${className}Service {\n      @Autowired\n     private ${className}Dao dao;\n\n      @Override\n     public List<Map<String, Object>> queryList(Map<String, Object> map) {\n          return dao.queryList(map);\n     }\n\n     @Override\n     public List<${className}Entity> getDbInfo() {\n          return dao.getDbInfo();\n     }\n\n     @Override\n     public ${className}Entity getInfo(Integer id) {\n          return dao.getInfo(id);\n     }\n     \n\n\n\n}\n', 'ServiceImpl.java', 'service\\impl', 10, 'java', '2018-06-04 15:08:31', '2018-06-04 16:15:20', NULL, 'gen ServiceImpl生成模板', '0');
INSERT INTO `t_code_templates` VALUES (11, 'DaoXml', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE mapper PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\" \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n\n<mapper namespace=\"${package}.${moduleName}.dao.${className}Dao\">\n\n	<!-- 可根据自己的需求，是否要使用 -->\n    <resultMap type=\"${package}.${moduleName}.entity.${className}Entity\" id=\"BaseResultMap\">\n#foreach($column in $columns)\n        <result property=\"${column.attrname}\" column=\"${column.columnName}\"/>\n#end\n    </resultMap>\n\n    <sql id=\"Base_Column_List\">\n        #foreach($column in $columns)\n            #if(${column.columnName} == ${column.attrname})${column.columnName}#else${column.columnName} AS ${column.attrname}#end,\n        #end\n    </sql>\n\n\n<select id=\"queryList\" resultType=\"map\">\n        SELECT <include refid=\"Base_Column_List\"/> FROM ${tableName}\n        <choose>\n            <when test=\"sidx!=null and sidx!=\'\'\">\n                order by ${sidx} ${order}\n            </when>\n            <otherwise>\n                order by MDF_TIME desc\n            </otherwise>\n        </choose>\n        <if test=\"offset != null and limit != null\">\n            limit #{offset}, #{limit}\n        </if>\n    </select>\n\n    <select id=\"getDbInfo\" resultType=\"${package}.${moduleName}.entity.${className}Entity\">\n       SELECT  <include refid=\"Base_Column_List\"/>  FROM ${tableName} order by MDF_TIME desc\n    </select>\n\n    <select id=\"getInfo\" resultType=\"${package}.${moduleName}.entity.${className}Entity\">\n        SELECT <include refid=\"Base_Column_List\"/>\n        FROM ${tableName} WHERE id=#{id}\n    </select>\n</mapper>', 'Dao.xml', 'main\\resources\\mapper', 10, 'xml', '2018-06-04 15:10:34', '2018-06-04 15:24:17', NULL, 'gen daoxml模板', '0');
INSERT INTO `t_code_templates` VALUES (12, 'Controller', 'package ${package}.${moduleName}.controller;\n\nimport ${package}.${moduleName}.entity.${className}Entity;\nimport ${package}.${moduleName}.service.${className}Service;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RestController;\nimport org.springframework.web.bind.annotation.ResponseBody;\nimport org.springframework.web.bind.annotation.RequestBody;\n\n\nimport com.creatsoft.common.utils.Query;\nimport com.creatsoft.common.utils.R;\nimport org.springframework.web.bind.annotation.*;\nimport com.creatsoft.common.utils.PageUtils;\nimport com.baomidou.mybatisplus.mapper.EntityWrapper;\nimport java.util.List;\nimport java.util.Map;\n\n/**\n * ${comments}\n *\n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\n@RestController\n@RequestMapping(\"${moduleName}/${pathName}\")\npublic class ${className}Controller {\n    @Autowired\n    private ${className}Service ${classname}Service;\n       /**\n      * 列表\n      */\n     @ResponseBody\n     @RequestMapping(\"/list\")\n     public R list(@RequestParam Map<String, Object> params) {\n          //查询列表数据\n          Query query = new Query(params);\n          List<Map<String, Object>> list =  ${classname}Service.queryList(query);\n          int total = ${classname}Service.selectCount(new EntityWrapper<>());\n          PageUtils pageUtil = new PageUtils(list, total, query.getLimit(), query.getPage());\n\n          return R.ok().put(\"page\", pageUtil);\n     }\n     \n     /**\n      * 信息\n      */\n     @ResponseBody\n     @RequestMapping(\"/info/{id}\")\n     public R info(@PathVariable(\"id\") Integer id) {\n          ${className}Entity ${classname}= ${classname}Service.getInfo(id);\n          return R.ok().put(\"${classname}\", ${classname});\n     }\n\n     /**\n      * 列表\n      */\n     @ResponseBody\n     @RequestMapping(\"/getDbInfo\")\n     public R getDbInfo() {\n          //查询列表数据\n          List< ${className}Entity> list = ${classname}Service.getDbInfo();\n          return R.ok().put(\"list\", list);\n     }\n\n       /**\n      * 新增\n      * @param ${classname}\n      * @return\n      */\n     @ResponseBody\n     @RequestMapping(\"/saveOrUpdate\")\n     public R saveOrUpdate(@RequestBody ${className}Entity ${classname}) {\n          return R.ok().put(\"result\",${classname}Service.insertOrUpdate(${classname}));\n     }\n\n  \n\n       /**\n      * 删除\n      */\n     @RequestMapping(\"/delete\")\n     @ResponseBody\n     public R delete(@RequestBody String[] ids) {\n          boolean flag=false;\n          for (String str:ids){\n              flag= ${classname}Service.deleteById(str);\n          }\n          return R.ok().put(\"result\",flag);\n     }\n   \n}\n', 'Controller.java', 'controller', 10, 'java', '2018-06-04 15:11:51', '2018-06-04 17:19:56', NULL, 'gen controller 模板', '0');
INSERT INTO `t_code_templates` VALUES (13, 'html', '<!DOCTYPE html>\n<html>\n<head>\n    <title>${comments}</title>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\" name=\"viewport\">\n    <link rel=\"stylesheet\" href=\"css/bootstrap.min.css\">\n    <link rel=\"stylesheet\" href=\"css/font-awesome.min.css\">\n    <link rel=\"stylesheet\" href=\"plugins/jqgrid/ui.jqgrid-bootstrap.css\">\n    <link rel=\"stylesheet\" href=\"css/main.css\">\n    <script src=\"libs/jquery.min.js\"></script>\n    <script src=\"plugins/layer/layer.js\"></script>\n    <script src=\"libs/bootstrap.min.js\"></script>\n    <script src=\"libs/vue.min.js\"></script>\n    <script src=\"plugins/jqgrid/grid.locale-cn.js\"></script>\n    <script src=\"plugins/jqgrid/jquery.jqGrid.min.js\"></script>\n    <script src=\"js/common.js\"></script>\n</head>\n<body>\n<div id=\"rrapp\" v-cloak>\n    <div v-show=\"showList\">\n        <div class=\"grid-btn\">\n            <a  class=\"btn btn-primary\" @click=\"add\"><i class=\"fa fa-plus\"></i>&nbsp;新增</a>\n            <a  class=\"btn btn-primary\" @click=\"update\"><i class=\"fa fa-pencil-square-o\"></i>&nbsp;修改</a>\n            <a  class=\"btn btn-primary\" @click=\"del\"><i class=\"fa fa-trash-o\"></i>&nbsp;删除</a>\n        </div>\n        <table id=\"jqGrid\"></table>\n        <div id=\"jqGridPager\"></div>\n    </div>\n\n    <div v-show=\"!showList\" class=\"panel panel-default\">\n        <div class=\"panel-heading\">{{title}}</div>\n        <form class=\"form-horizontal\">\n            #foreach($column in $columns)\n                #if($column.columnName != $pk.columnName)\n                    <div class=\"form-group\">\n                        <div class=\"col-sm-2 control-label\">${column.comments}</div>\n                        <div class=\"col-sm-10\">\n                            <input type=\"text\" class=\"form-control\" v-model=\"${classname}.${column.attrname}\" placeholder=\"${column.comments}\"/>\n                        </div>\n                    </div>\n                #end\n            #end\n            <div class=\"form-group\">\n                <div class=\"col-sm-2 control-label\"></div>\n                <input type=\"button\" class=\"btn btn-primary\" @click=\"saveOrUpdate\" value=\"确定\"/>\n                &nbsp;&nbsp;<input type=\"button\" class=\"btn btn-warning\" @click=\"reload\" value=\"返回\"/>\n            </div>\n        </form>\n    </div>\n</div>\n<script src=\"/js/${className}.js\"></script>\n</body>\n</html>', '.html', 'main\\resources\\views', 10, 'html', '2018-06-04 16:04:05', '2018-06-04 17:13:44', NULL, 'html 页面', '0');
INSERT INTO `t_code_templates` VALUES (14, 'js', '$(function () {\n    $(\"#jqGrid\").jqGrid({\n        url: \'${moduleName}/${pathName}/list\',\n        datatype: \"json\",\n        colModel: [			\n#foreach($column in $columns)\n#if($column.columnName == $pk.columnName)\n			{ label: \'${column.attrname}\', name: \'${column.attrname}\', index: \'${column.columnName}\', width: 50, key: true },\n#else\n			{ label: \'${column.comments}\', name: \'${column.attrname}\', index: \'${column.columnName}\', width: 80 }#if($velocityCount != $columns.size()), #end\n			\n#end			\n#end\n        ],\n		viewrecords: true,\n        height: 385,\n        rowNum: 10,\n		rowList : [10,30,50],\n        rownumbers: true, \n        rownumWidth: 25, \n        autowidth:true,\n        multiselect: true,\n        pager: \"#jqGridPager\",\n        jsonReader : {\n            root: \"page.list\",\n            page: \"page.currPage\",\n            total: \"page.totalPage\",\n            records: \"page.totalCount\"\n        },\n        prmNames : {\n            page:\"page\", \n            rows:\"limit\", \n            order: \"order\"\n        },\n        gridComplete:function(){\n        	//隐藏grid底部滚动条\n        	$(\"#jqGrid\").closest(\".ui-jqgrid-bdiv\").css({ \"overflow-x\" : \"hidden\" }); \n        }\n    });\n});\n\nvar vm = new Vue({\n	el:\'#rrapp\',\n	data:{\n		showList: true,\n		title: null,\n		${classname}: {}\n	},\n	methods: {\n		query: function () {\n			vm.reload();\n		},\n		add: function(){\n			vm.showList = false;\n			vm.title = \"新增\";\n			vm.${classname} = {};\n		},\n		update: function (event) {\n			var $pk.attrname = getSelectedRow();\n			if($pk.attrname == null){\n				return ;\n			}\n			vm.showList = false;\n            vm.title = \"修改\";\n            \n            vm.getInfo(${pk.attrname})\n		},\n		saveOrUpdate: function (event) {\n			var url = \"${moduleName}/${pathName}/saveOrUpdate\";\n			$.ajax({\n				type: \"POST\",\n			    url: url,\n                contentType: \"application/json\",\n			    data: JSON.stringify(vm.${classname}),\n			    success: function(r){\n			    	if(r.code === 0){\n						alert(\'操作成功\', function(index){\n							vm.reload();\n						});\n					}else{\n						alert(r.msg);\n					}\n				}\n			});\n		},\n		del: function (event) {\n			var ${pk.attrname}s = getSelectedRows();\n			if(${pk.attrname}s == null){\n				return ;\n			}\n			\n			confirm(\'确定要删除选中的记录？\', function(){\n				$.ajax({\n					type: \"POST\",\n				    url:  \"${moduleName}/${pathName}/delete\",\n                    contentType: \"application/json\",\n				    data: JSON.stringify(${pk.attrname}s),\n				    success: function(r){\n						if(r.code == 0){\n							alert(\'操作成功\', function(index){\n								$(\"#jqGrid\").trigger(\"reloadGrid\");\n							});\n						}else{\n							alert(r.msg);\n						}\n					}\n				});\n			});\n		},\n		getInfo: function(${pk.attrname}){\n			$.get( \"${moduleName}/${pathName}/info/\"+${pk.attrname}, function(r){\n                vm.${classname} = r.${classname};\n            });\n		},\n		reload: function (event) {\n			vm.showList = true;\n			var page = $(\"#jqGrid\").jqGrid(\'getGridParam\',\'page\');\n			$(\"#jqGrid\").jqGrid(\'setGridParam\',{ \n                page:page\n            }).trigger(\"reloadGrid\");\n		}\n	}\n});', '.js', 'main\\resources\\static\\js', 10, 'js', '2018-06-04 16:06:02', '2018-06-04 17:19:35', NULL, 'gen js 模板', '0');
